import axios from "axios";

function DisplayUpper({prop, fetch}) {

    axios.get('http://localhost:5000')
            .then(res => {
                fetch(res.data);
            })
            .catch(function (error) {
                console.log(error);
            })
    return (
        <div>
        <h1>HI, {prop} </h1>
        </div>
    );
}

export default DisplayUpper;
